import axios from "axios"
import { BaseUrl } from "../shared/BaseUrl"
import { myHeaders } from "../shared/MyHeaders"

const getUsers = async (page) => {
    console.log(page);

    const { data } = await axios.get(`${BaseUrl}/users?page=${page}&size=10`, {
        headers: myHeaders
    })
    return data
}

const getDataUsers = async () => {
    console.log(page);

    const { data } = await axios.get(`${BaseUrl}/users?page=0&size=10000000000`, {
        headers: myHeaders
    })
    return data
}

export {
    getUsers, getDataUsers
}
